import * as React from "react";
import "./Projects.css";

function Projects() {
  const variants = {
    visible: { opacity: 1 },
    hidden: { opacity: 0 },
  };
  return (
    <React.Fragment>
      <div className="projects-wrapper">
        <section>
          <h2>What I've Built</h2>
          <div className="grid">
            <div className="card  col-span-2">
              <h3>Card</h3>
            </div>
            <div className="card  col-span-2">
              <h3>Card</h3>
            </div>
            <div className="card">
              <h3>Card</h3>
            </div>
            <div className="card">
              <h3>Card</h3>
            </div>
          </div>
        </section>
      </div>
    </React.Fragment>
  );
}

export default Projects;
